import styled from 'styled-components';

export const InputTag = styled.input`
  width: 30vh;
  height: 10vh;
  border: 3px solid black;
  font-size: 25px;
  padding: 15px;
  border-radius: 20px;
  justify-content: center;
  align-items: center;
`;

export const WeatherInfoWrapper = styled.div`
  display: flex;
  flex-direction: column;
  border: 2px solid black;
  border-radius: 20px;
  margin-top: 3vh;
  justify-content: center;
  align-items: center;
  width: 35vh;
  height: 35vh;
  font-size: 4vh;
`;

export const WeatherTitle = styled.div`
  position: relative;
  left: 5px;
`;
